import React from "react";

const cons = require("../assets/construction.jpg").default;

const Offer = (props) => {
  return (
    <div
      className=""
      style={{
        backgroundImage: `url(${props.icon})`,
        width: 550,
        height: 550,
        backgroundPosition: "center",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        margin: 20,
        cursor: "pointer",
        textDecoration: "none",
      }}
    >
      <a
        className="zoom"
        href={props.link}
        style={{
          backgroundImage: `url(${props.icon})`,
          width: 550,
          height: 550,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          margin: 20,
          cursor: "pointer",
          textDecoration: "none",
        }}
      >
        <h3
          style={{
            fontSize: 30,
            fontWeight: "bold",
            color: "white",
            marginTop: 450,
            textShadow: "2px 2px #000",
          }}
        >
          {props.title}
        </h3>
      </a>
    </div>
  );
};

const styles = {
  image: {},
};

export default Offer;
